import React, { Component } from 'react';
import Navigation from './components/navigation/Navigation'
import Logo from './components/logo/Logo'
import Rank from './components/rank/Rank'
import Particles from 'react-particles-js';
import ImageLinkForm from './components/imageLinkForm/ImageLinkForm'
import Clarifai, {ClarifaiStub, grpc} from 'clarifai-nodejs-grpc';
import './App.css';

const stub = ClarifaiStub.grpc();
const app = new Clarifai.App({
  apiKey: '8509e0668a58483db493b84a27c67428'
});
const metadata = new grpc.Metadata();
metadata.set("authorization", "Key {8509e0668a58483db493b84a27c67428}");

const particlesOptions = {
  particles: {
    number: {
      value: 10,
      density: {
        enable: true,
        value_area: 600,
      }
    },
    color: {
      value: "red"
    }
  },
  line_linked:{
    enable_auto: true,
  }
}

class App extends Component {
  constructor(){
    super();
    this.state = {
      input: "",
    }
  }

  onInputChange = (event) =>{
    console.log(event.target.value)
  }

  onButtonSubmit = () =>{
    console.log("clicked")
    app.models.predict('f76196b43bbd45c99b4f3cd8e8b40a8a', "https://samples.clarifai").then(
      function(response) {

      },
      function(err){

      }
    )
  }
  render(){
  return (
    <div className="App">
      <Particles className="particles"
        params={particlesOptions} />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm
        onInputChange={this.onInputChange}
        onButtonSubmit={this.onButtonSubmit}
      />
      {/*
      <FaceRecognition /> */}
    </div>
  );}
}

export default App;
